import React from 'react';
import './header.css';
import config from '../../config'
function Header() {
    return (
        <header className="bg-danger text-light fixed top-0">
            <div className="container mx-auto px-4">
                <div className="flex items-center">
                    <div className="logo text-3xl font-bold">Harry</div>




                    <div className="flex justify-end">
                        <nav className="flex flex-wrap items-center">
                            <a href="#aboutme" className="mr-4 text-white">About</a>
                            <a href="#education" className="mr-4 text-white">Education</a>
                            <a href="#project" className="mr-4 text-white">Project</a>
                            <a href="#gallery" className="text-white">Gallery</a>
                        </nav>
                    </div>
                </div>
            </div>
        </header>
    );
}
export default Header;
